import React, { useState } from "react";
import { Link, useHistory, useNavigate } from "react-router-dom";
import "../styles/SignUpPage.css";
import axios from "axios";
import { createAPIEndpoint, ENDPOINTS } from "../API";
import Cookies from "js-cookie";
import BackButton from "../image/backButton.png";
import SignUpImage from "../image/SignUpImage.jpeg";

function signUpPage({ onBack, BackToLogIn }) {
  const navigate = useNavigate();

  const [username, setusername] = useState("");
  const [password, setPassword] = useState("");
  const [confirmPassword, setConfirmPassword] = useState("");
  const [showLabel, setshowLabel] = useState(false);
  const [backlogin, setbacklogin] = useState(true);
  const [begin, setbegin] = useState(true);

  const handleSubmit = async (event) => {
    event.preventDefault();

    if (password !== confirmPassword) {
      alert("Passwords don't match");
      setshowLabel(true);
      setshowLabel("Password and Confirm Password not match!!! ");
      // setusername('');
      setPassword("");
      setConfirmPassword("");

      return;
    }
    try {
      // Send a POST request to the server to create a new user
      // const response = await axios.post('http://localhost:9000/user/signUp', {
      //   userName: username,
      //   password: password,
      //   confirmedPassword:confirmPassword
      // });

      const response = await createAPIEndpoint(ENDPOINTS.UserSignUp).post({
        userName: username,
        password: password,
        confirmedPassword: confirmPassword,
      });

      Cookies.set("accessToken", response.data.accessToken);
      Cookies.set("refreshToken", response.data.refreshToken);
      Cookies.set("role", "User");

      console.log(Cookies.get("accessToken"));

      // Show success message and redirect to login page
      alert("Account successfully created!");
      navigate("/ClientPage");
      // setbacklogin(false);
    } catch (error) {
      setshowLabel(`${error.response.data.error}`);
      console.error(error);
      // alert(`${username},${password},${confirmPassword}`);
      alert("Failed to create account");
      return;
    }
    // setshowLabel(false);
    // setbegin(false);
    // setusername(false);
    // setPassword(false);
    // setConfirmPassword(false);
    // // Perform sign up action, for example by calling an API
    // console.log(`Signing up with username: ${username} and password: ${password}`);
    // setbacklogin(false);
  };

  return (
    <>
      {backlogin ? (
        <div className="whole_signup overlay">
          <h1 className="signup_h1"></h1>
          <form className="signup_form" onSubmit={handleSubmit}>
            <button onClick={onBack} className="loginbb" href="/" id="bottle">
              <img src={BackButton} alt="bottle" />
            </button>
            {begin}
            <div className="signup-background">
              <img src={SignUpImage} alt="Login Image" />
            </div>
            <div className="in_signup">
              <h2>Sign Up</h2>
              <div>
                <label className="signup_label_username" htmlFor="username">
                  Username
                </label>
                <input
                  className="signup_input"
                  type="username"
                  id="username"
                  value={username}
                  onChange={(event) => setusername(event.target.value)}
                  required
                />
              </div>
              <div>
                <label className="signup_label_pass" htmlFor="password">
                  Password
                </label>
                <input
                  className="signup_input"
                  type="password"
                  id="password"
                  value={password}
                  onChange={(event) => setPassword(event.target.value)}
                  required
                />
              </div>
              <div>
                <label
                  className="signup_label_conpass"
                  htmlFor="confirmPassword"
                >
                  Confirm Password
                </label>
                <input
                  className="signup_input"
                  type="password"
                  id="confirmPassword"
                  value={confirmPassword}
                  onChange={(event) => setConfirmPassword(event.target.value)}
                  required
                />
              </div>
              {showLabel && <label className="show-label">{showLabel}</label>}
              <button className="signup_button" type="submit">
                CREATE ACCOUNT
              </button>

              <div className="already-have-account">
                Already have an account?
                <button onClick={BackToLogIn} className="signup_link">
                  {" "}
                  Sign In
                </button>
              </div>
            </div>
          </form>
        </div>
      ) : (
        <div>
          <h1 className="empty"> </h1>
          <form className="con_signup_form" onSubmit={handleSubmit}>
            <label className="backlogin">
              <h1 className="backlogin_h1">Congraturation!</h1> You have
              successfully created a new account .Click{" "}
              <a className="signup_link" href="/LoginPage">
                {" "}
                Sign In
              </a>{" "}
              to get back to log in page
            </label>
          </form>
        </div>
      )}
    </>
  );
}

export default signUpPage;
